import React from "react";
import naruto from "./naruto.jpg";

export default function Card({ bgMainColor, bgSecondaryColor, cardTitle }) {
  return (
    <div
      className={`flex flex-col justify-center items-center gap-3 border-2 text-white rounded-lg ${bgMainColor}`}
    >
      <div className={`${bgSecondaryColor} h-3/4 w-5/6 rounded-lg`}>
        <img src={naruto} className="h-full opacity-0.1" />
      </div>
      <p> {cardTitle} </p>
    </div>
  );
}
